    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text116"><tspan
         x="0 6.6479998 13.2 16.236 20.098801 25.462799 30.9468 33.9828 36.948002 43.428001 49.307999 54.9744 60.037201 66.338402 71.378403 74.414398 78.6744 81.866402 87.338402 90.374397 94.634399 99.697197 102.6036 108.0876 111.1236 114.3156 120.8676 127.2036 130.23959 133.43159 136.46761 141.5424 145.2504 148.28641 152.5464 158.71561 168.60361 178.49159 183.49561 187.9704 194.29559 200.7756 205.0356 208.07159 211.2636 213.8808 220.55521 225.5952 229.85519 233.5632 236.6232 242.03281 245.1156 248.1396 253.3716 259.92361 266.25961 269.29559 274.30081 280.85281 283.88879 289.38361 294.6156 299.1012 308.9892 312.02521 316.28519 322.45441 332.34241 342.23041 347.2356 351.68521 354.7092 360.91321 365.17441 371.51041 376.7424 382.35721 384.87961 387.91559 396.6756 401.6796 406.08359 409.1196 414.6156 419.8476 424.25159 427.2876 430.47961 437.03159 442.47961 447.4848 454.0368 457.07281 463.46881 466.52881 471.53281 481.42081 491.30881 496.34879 498.87119"
         y="0"
         id="tspan72">En tyv lukkede sig selv ind i et sommerhus i Vestjylland en varm sommerlørdag. Der var ingen hjemme, </tspan><tspan
         x="0 3.5051999 9.6731997 14.0772 17.113199 23.4144 28.4196 34.9716 38.007599 41.5476 46.779598 56.667599 59.8596 62.883598 66.0756 71.115601 73.636803 76.672798 82.973999 87.979202 92.383202 95.419197 101.634 107.8728 112.9368 119.2368 124.2768 127.3128 130.50481 133.5408 139.866 146.34599 150.606 155.68201 159.39 161.9124 164.94839 170.44321 175.6752 180.07919 183.1152 188.5872 193.8192 198.894 202.60201 205.638 212.19 217.254 223.59 226.62601 230.3688 233.56081 236.58479 239.6208 243.8808 247.6584 252.15601 257.388 263.94 270.24121 275.24521 281.79721 284.83319 288.33841 294.5076 298.91159 301.9476 307.1796 310.8876 313.92361 320.10361 325.35959 331.65961 336.69958 339.7356 342.92761 345.96359 352.2648 357.3396 361.04761 364.08359 370.08359 376.08359 382.08359 388.08359 394.08359 400.08359 406.08359 412.08359 418.08359 424.08359 430.08359 436.08359 442.08359 448.08359 454.08359 460.08359 463.1196 468.414 473.5968 476.6568 480.39001 482.91241"
         y="27.996"
         id="tspan74">for den familie, der boede i huset, var gået ned til stranden for at bade i det ________________ vejr. </tspan><tspan
         x="0 8.7600002 13.8348 17.542801 20.5788 26.0748 31.306801 35.7108 38.746799 42.349201 47.354401 57.242401 67.130402 72.193199 75.217201 78.409203 83.881203 86.917198 92.917198 98.917198 104.9172 110.9172 116.9172 122.9172 128.91721 134.91721 140.91721 146.91721 152.91721 158.91721 164.91721 170.91721 176.91721 182.91721 185.9532 189.4584 195.6264 200.0304 203.06641 206.9304 212.2944 217.5876 222.5916 229.1436 232.1796 237.41161 241.1196 244.15559 249.798 255.96719 265.85519 275.74319 280.7832 283.81921 287.0112 293.5632 299.8992 302.4216 305.45761 314.34961 320.55359 326.19241 329.2164 334.22159 340.77359 343.8096 346.83359 352.06561 355.10159 361.65359 366.65881 376.54681 379.5708 382.76279 388.2348 391.27081 397.75079 404.3028 410.60281 415.608 420.01199 423.048 428.05319 434.60519 437.6412 440.66519 443.85721 446.94 449.96399 455.004 457.5264 460.56241 464.10239 467.1264 472.38239 478.71841 481.75439 486.0144 489.61801 494.62201 501.17401"
         y="84"
         id="tspan76">Det var temmelig ________________ for tyven at komme ind. Nøglen lå nemlig under en lille, flad sten </tspan><tspan
         x="0 3.0239999 6.2160001 11.664 16.704 19.74 25.034401 30.0972 36.433201 39.4692 43.729198 46.9212 53.222401 58.226398 64.778397 67.8144 73.046402 76.944 79.980003 86.375999 92.447998 97.741203 102.8052 109.1412 115.4772 121.6812 125.9412 130.94521 137.49719 140.0208 143.05679 147.3168 152.5488 155.58479 159.44881 164.81281 170.106 175.11 181.662 184.698 188.23801 193.47 200.022 206.358 210.06599 213.10201 219.4032 224.4072 230.9592 233.99519 240.5472 248.3952 252.6552 256.2576 261.26279 267.81479 270.8508 280.7388 285.80161 292.1376 295.17361 301.47479 306.54959 310.2576 313.29361 317.55359 322.78561 332.67361 342.56161 347.60159 350.12399"
         y="111.996"
         id="tspan78">lige ved siden af hoveddøren, så tyven fandt den næsten med det samme. </tspan><tspan
         x="0 8.7480001 13.98 17.016001 20.556 25.788 35.675999 38.868 41.891998 45.084 50.088001 56.639999 59.675999 65.318398 71.487602 81.375603 84.411598 90.807602 93.867599 98.871597 108.7596 111.7956 115.3356 119.8332 125.0652 128.1012 132.36121 136.14 140.6376 145.8696 152.4216 158.7576 162.4536 168.93359 173.1936 178.1976 184.7496 187.272 190.308 196.188 202.668 209.22 215.772 220.812 223.84801 230.1492 235.18919 238.2252 244.2252 250.2252 256.22519 262.22519 268.22519 274.22519 280.22519 286.22519 292.22519 298.22519 304.22519 310.22519 316.22519 322.22519 328.22519 334.22519 336.74759 339.7836 345.01559 348.7236 351.75961 358.06079 363.1008 366.13681 372.53281 377.5632 382.87921 389.18039 394.2204 397.25641 403.6524 408.8844 412.42441 416.13239 419.1684 424.17239 430.7244 433.76041 439.23239 447.08041 451.34039 455.0484 457.5708 460.60681 467.16119 470.8692 473.90521 480.15839 485.7012 490.30679 494.0148"
         y="139.992"
         id="tspan80">Da familien kom hjem fra strandturen, kunne de ________________, at de havde haft en gæst. Et dyrt </tspan><tspan
         x="0 5.8800001 11.112 21 26.004 30.5016 35.733601 38.7696 44.997601 50.469601 53.5056 58.509602 65.0616 68.097603 74.433601 80.913597 87.465599 92.937599 95.973602 105.8616 110.9256 117.2616 120.2976 123.3216 126.5136 132.84959 136.5576 139.5936 145.9884 150.99361 157.54559 162.99361 168.0336 171.0696 177.29761 182.76961 185.8056 190.8804 194.58839 197.6244 203.9604 209.1924 215.7444 221.3868 227.556 232.16161 235.8696 238.90559 244.40041 249.6324 254.03641 257.07239 262.5564 270.40439 276.28439 278.80679 281.8428 290.60281 295.64279 298.6788 303.21359 306.40561 312.95761 318.4068 323.4696 329.77081 334.81079 337.8468 347.7348 352.79761 359.13361 362.16959 368.47079 373.54559 377.2536 380.28961 384.54959 389.78159 399.66959 409.55759 414.5976 417.63361 421.3764 424.56839 427.59241 430.62839 436.9296 441.93359 446.19479 451.2348 455.49481 458.53079 464.71078 469.94281 476.49481 482.37479 485.4108 491.63879 497.11081"
         y="167.98801"
         id="tspan82">kamera og en pung med lidt penge og et dankort var væk. De ringede med det samme til deres bank og </tspan><tspan
         x="0 4.2600002 10.596 18.444 22.98 27.24 32.302799 38.604 43.644001 46.68 53.015999 58.248001 64.800003 70.442398 76.611603 81.217201 84.819603 89.894402 93.602402 96.124802 99.160797 103.4208 108.6528 111.6888 115.5528 120.9168 126.21 131.214 137.76601 140.802 143.994 149.87399 155.54041 160.5804 163.61639 169.4964 175.97639 182.5284 189.0804 194.12041 197.1564 203.1564 209.1564 215.1564 221.1564 227.1564 233.1564 239.1564 245.1564 251.1564 257.1564 263.1564 269.1564 275.1564 281.1564 287.1564 293.1564 296.19241 302.49359 307.56839 311.2764 313.7988 316.83481 325.59479 330.60001 335.004 338.04001 347.92801 353.16 359.71201 365.34961 368.3736 373.43759 379.7388 384.77881 387.81479 393.81479 399.81479 405.81479 411.81479 417.81479 423.81479 429.81479 435.81479 441.81479 447.81479 453.81479 459.81479 465.81479 471.81479 477.81479 483.81479"
         y="195.98399"
         id="tspan84">spærrede dankortet, så tyven ikke kunne ________________ det. Der manglede ________________ </tspan><tspan
         x="0 6.552 12.7788 18.228001 23.302799 27.010799 30.046801 39.934799 45.189602 51.5256 54.5616 57.753601 60.7896 66.669601 72.873596 75.897598 80.937599 85.197601 91.077599 96.309601 102.5244 107.6004 111.3084 114.3444 120.5724 126.0444 129.0804 134.0856 140.6376 143.6736 149.87759 152.9016 155.4252 158.4612 164.7132 170.07719 175.37041 180.3756 186.9276 189.96359 196.3596 201.39 206.7072 213.0072 218.0472 221.08321 226.3152 232.53 237.5352 244.0872 250.2672 255.49921 260.1048 263.81281 266.84879 271.1088 277.44479 280.63681 284.89679 288.6048 291.64081 295.18079 299.418 305.62201 311.2644 317.46841 321.72839 325.4364 327.9588 330.99481 341.37601 346.3812 352.9332 355.96921 362.3652 367.5972 374.1492 377.18521 383.58121 388.6116 393.9288 400.22879 405.2688 408.30481 411.4968 417.3768 423.04321 428.08319 431.1192 435.35519 441.59521 447.8952 452.97119 456.6792 459.71521 462.9072 465.94321 471.82321 478.02719 483.9072 489.57361 494.5788 501.1308 506.2056 509.9136 512.43597"
         y="223.98"
         id="tspan86">noget mad i køleskabet og en øl. Tyven havde åbenbart spist frokost. Men han havde ikke rodet i køkkenet, </tspan><tspan
         x="0 6.2280002 11.7 14.736 21.132 26.364 32.916 35.952 42.348 47.378399 52.694401 58.995602 64.035599 67.071602 72.567596 77.799599 82.059601 87.7248 92.799599 96.507599 99.543602 105.6888 112.0248 115.0608 120.078 123.618 127.2204 132.2256 136.62959 139.6656 143.9256 147.1176 152.73241 155.25481 158.2908 164.9868 170.2188 173.25481 177.5148 183.8508 187.0428 191.3028 196.3656 202.5804 208.7496 213.0096 219.31081 224.3856 228.0936 231.12959 234.15359 239.3856 242.4216 248.72279 253.728 258.13199 261.168 266.2428 269.95081 272.98679 277.2468 281.10959 286.52039 292.40039 298.0668 303.10681 306.14279 312.47879 317.71078 324.04681 327.2388 330.97079 333.49319 336.52921 342.52921 348.52921 354.52921 360.52921 366.52921 372.52921 378.52921 384.52921 390.52921 396.52921 402.52921 408.52921 414.52921 420.52921 426.52921 432.52921 435.56519 441.86639 446.87161 451.2756 454.31161 458.57159 462.16199 468.40079 474.73679"
         y="251.976"
         id="tspan88">og han havde vasket op efter sig. På spisebordet lå der et stykke papir, ________________ der stod </tspan><tspan
         x="0 5.4095998 11.4372 16.669201 22.5492 25.585199 29.090401 35.259602 39.663601 42.6996 52.587601 57.8424 64.178398 67.406403"
         y="279.97198"
         id="tspan90">“Tak for mad!”</tspan><tspan

         y="307.96799"
         id="tspan92">Familien syntes, det var lidt sjovt, at det var en høflig tyv, der havde været på besøg. Men de var kede af, at </tspan><tspan
         x="0 6.3959999 11.628 18.18 21.216 27.612 32.641201 37.958401 44.2584 49.298401 52.3344 58.3344 64.334396 70.334396 76.334396 82.334396 88.334396 94.334396 100.3344 106.3344 112.3344 118.3344 124.3344 130.3344 136.3344 142.3344 148.3344 151.37041 157.2504 162.48241 172.37041 177.3756 181.8732 187.12801 192.20399 195.912 198.948 208.836 213.89999 220.23599 223.272 228.504 231.58681 234.61079 239.6508 242.6868 248.9868 253.992 258.25201 263.29199 267.552 270.58801 274.0932 279.09839 283.63321 286.8252 291.88919 298.03439 301.22641 304.30801 307.332 312.396 318.69601 323.7012 327.43439 329.95679 332.9928 343.37399 348.37921 354.93121 357.96719 363.04199 366.75 369.78601 376.12201 381.354 385.758 388.79401 395.13 400.362 405.81119 410.8512 413.88721 418.90439 422.4444 426.04681 431.052 435.45599 438.492 444.13559 450.30359 460.19159 463.2276 469.52881 474.534 478.93799 481.974 487.0488 490.75681 493.79279 499.9368 504.198 509.31961 514.80359"
         y="335.96399"
         id="tspan94">han havde ________________ kameraet med alle deres feriebilleder. Men et par dage efter kom der et brev </tspan><tspan
         x="0 9.8879995 14.9508 21.2868 24.3228 29.326799 35.878799 38.914799 43.7868 50.122799 53.158798 59.386799 64.858803 67.894798 72.898804 79.450798 82.486801 85.510803 88.702797 91.785599 94.809601 99.849602 102.8856 107.1456 112.2084 118.5444 124.8456 129.90961 132.93359 135.45599 138.492 145.188 150.42 153.45599 158.328 164.664 167.604 172.608 179.16 182.196 187.692 192.924 197.328 200.364 206.664 211.6692 215.9292 220.96919 225.2292 228.2652 231.7704 236.7756 241.31039 244.5024 249.56641 255.71159 258.90359 261.9852 265.00919 270.07321 276.3732 281.37839 285.1116 287.634 290.67001 297.366 302.59799 305.634 309.89401 314.95679 321.35159 324.37561 329.3808 335.9328 338.96881 343.22879 346.81921 353.05801 359.39401 362.42999 368.7312 373.73639 378.14041 381.17639 387.35641 392.58841 396.84961 401.88959 404.20801 409.61761 415.64401 420.87601 426.75601 429.79199 433.29721 439.46521 443.8692 446.90521 449.9292 455.16119 461.7132 464.94119 469.44241 472.47839 481.2384 486.27841"
         y="363.95999"
         id="tspan96">med en cd og en lille seddel. På cd’en var deres feriebilleder. På sedlen stod der bare “Tak for lån!” De </tspan><tspan
         x="0 6.1560001 9.1800003 14.3028 19.7868 22.8228 28.8228 34.8228 40.8228 46.8228 52.8228 58.8228 64.8228 70.8228 76.8228 82.8228 88.8228 94.8228 100.8228 106.8228 112.8228 118.8228 121.8588 127.9308 133.224 138.2292 142.63319 145.6692 150.9012 154.60921 157.6452 161.1852 166.41721 169.4532 175.5984 178.79041 181.8732 184.8972 189.96001 196.2612 201.2664 205.752 212.304 217.34399 220.38 224.1228 227.3148 230.33881 236.5188 241.75079 247.19881 252.2388 254.7612 257.79721 266.6676 272.13959 275.1756 281.47559 286.55161 290.25961 293.29559 296.31961 299.5116 302.59439 305.61841 310.65839 313.6944 319.8396 324.09961 329.22119 334.7052 337.74121 341.28119 344.47321 350.35321 353.38919 359.6904 364.6944 374.5824 377.61841 381.3624 384.55441 387.5784 390.61441 395.84641 399.55441 402.59039 406.8504 416.7384 419.93039 422.95441 427.99438 430.51682"
         y="391.95599"
         id="tspan98">blev ________________ over at få billederne tilbage. Og det lille brev fik dem til at smile, </tspan><tspan
         x="0 6 12 18 24 30 36 42 48 54 60 66 72 78 84 90 96 99.036003 105.3372 110.412 114.12 117.156 122.652 127.884 132.28799 135.32401 139.584 144.81599 151.15199 156.384 162.936 165.972 170.9772 177.52921 180.5652 186.9612 193.16521 196.7052 199.7292 202.9212 208.3932 211.4292 215.2932 220.6572 225.51961"
         y="419.952"

         id="tspan154">Ordene findes i rammen nederst på siden. </tspan><tspan

       id="text146"><tspan
         x="0 5.9520001 11.484 16.3776 21.909599 24.549601 28.548 33.720001 40.487999 45.155998 50.329201 57.097198 59.737202 63.0732 68.338799 73.835999 79.009201 83.797203 86.437202 91.68 95.652 98.292 101.628 105.0012 110.0568 112.6392 115.2792 121.7844 126.9564 131.7444 134.3844 139.5576 144.3456 146.9856 157.01759 162.2964 167.9964 173.2392 177.2112 179.8512 185.38319 192.1512 198.6564 203.82961 208.722 212.058 217.28999 223.7952 229.0032 233.6712 236.3112 241.48441 248.2524 254.7924 257.4324 264.11639 269.28839 276.0564 282.56161 287.76959 292.43759 295.07761 300.5748 305.7468 312.5148 315.97079 322.7388 329.24399 334.41599 339.228 343.896 346.47839 349.11841 357.8688 364.5408 371.30881 373.94879 380.41681 383.75281 389.01959 394.69559 397.3356 404.10361 409.27679 419.30881 422.64481 426.1008 431.8248 434.46481 444.4968 450.7608 454.87799 457.46039 460.1004 466.64041 472.17239"
         y="0"
         id="tspan142">Sara Jensen lever et liv, der er meget anderledes end hendes veninders. Hun blev nemlig mor, da </tspan><tspan

         y="15.996"
         id="tspan144">hun kun var 17 år gammel. </tspan></text>

       id="text162"><tspan
         x="0 4.0320001 7.0679998 13.404 18.636 24.108 27.143999 32.1492 36.5532 39.589199 45.324001 50.556 55.0536 60.285599 63.321602 69.081596 74.841599 77.877602 83.109596 86.841599 89.365196 92.401199 98.627998 104.1 107.136 113.4612 119.9412 126.4932 129.52921 135.744 141.91319 146.3172 149.3532 153.6132 158.8452 168.7332 178.6212 183.6252 190.1772 193.2132 203.1012 208.16521 214.50121 217.5372 221.7972 224.9892 231.5412 234.57719 238.8372 245.0412 251.5932 254.6292 263.18759 269.45041 274.6824 281.0784 284.11441 287.3064 290.34241 295.34641 301.89841 304.93439 307.9584 313.1424 316.20239 319.22641 322.4184 328.0332 334.4292 339.49319 345.82919 348.8652 352.05719 355.0932 360.80521 367.00919 373.56119 379.8624 384.86761 389.4144 395.62921 401.7984 406.20239 411.81839 414.34079 417.3768 423.1116 428.3436 432.84119 438.07321 441.10919 446.11441 450.5184"
         y="0"
         id="tspan154">I dag er Sara 19 år, og hun bor sammen med sin søn Noah i en lejlighed i Sønderborg. Sara er </tspan><tspan
         x="0 3.1919999 9.0719995 14.7384 19.7784 22.8144 28.694401 36.5424 40.802399 45.8424 50.102402 53.7048 58.744801 61.7808 71.6688 76.731598 83.067596 86.1036 94.662003 100.9236 106.1556 112.5516 116.8116 119.8476 123.3876 128.6196 132.3528 134.8752 137.91119 147.79919 152.8044 159.3564 162.3924 168.78841 174.0204 180.5724 183.6084 189.8244 195.9924 200.39639 203.4324 206.6244 209.6604 216.2124 224.06039 228.534 234.92999 239.994 246.29401 251.29919 257.8512 260.3736 263.40961 269.6376 275.10959 278.1456 286.70279 292.96561 298.1976 304.5936 307.62961 312.63361 317.0376 320.07361 326.4696 332.67361 336.93359 339.9696 346.3656 351.5976 361.4856 364.52161 370.6188 375.91199 380.91721 385.3212 388.35721 393.5892 400.1412 406.44119 411.44641 417.99841 421.03439 429.08759 434.15161 439.19159 444.858 449.862 456.414 462.75 465.2724"
         y="27"
         id="tspan156">ikke kæreste med Noahs far, men han bor i nærheden, og Noah er hos ham hver anden weekend. </tspan><tspan
         x="0 5.7360001 10.968 15.4656 20.697599 24.9576 27.993601 31.4988 37.667999 42.071999 49.919998 52.944 59.279999 63.540001 68.580002 71.615997 77.830803 84 88.403999 91.440002 97.835999 102.8988 105.9816 109.0056 114.0108 118.4148 121.4508 124.6428 130.5228 136.188 141.228 144.26401 147.28799 152.52 159.07201 164.54401 168.252 171.28799 176.772 184.62 190.5 193.02119 196.05721 202.05721 208.05721 214.05721 220.05721 226.05721 232.05721 238.05721 244.05721 250.05721 256.05719 262.05719 268.05719 274.05719 280.05719 286.05719 292.05719 294.57959 297.6156 306.37561 311.45041 315.15839 318.1944 323.19958 327.60361 330.63959 335.13721 340.3692 344.97479 348.6828 351.71881 355.224 361.39319 365.79721 368.83319 375.22919 380.23441 386.78641 393.08759 398.12759 401.1636 406.3956 410.10361 413.13959 418.8024 421.99438 428.29559 433.3356 435.858 438.89401 444.12601 447.83401"
         y="54"
         id="tspan158">Saras forældre bor heller ikke langt væk. ________________. Det er rart for hende at vide, at </tspan><tspan
         x="0 6.3252001 12.8052 19.357201 22.3932 27.6252 30.6492 34.391998 37.584 43.919998 46.956001 52.835999 58.068001 64.620003 67.655998 72.192001 75.384003 81.935997 87.384003 92.424004 95.459999 99.202797 102.3948 105.4188 108.4548 114.756 119.76 129.64799 132.68401 138.912 144.384 147.42 153.6348 158.69881 164.99879 170.0388 173.0748 179.37601 184.3812 194.2692 197.30521 203.47321 213.36121 216.3972 221.6292 225.3372 228.3732 234.2532 237.44521 242.94 248.38921 253.4292 256.46521 259.96921 266.1384 270.6864 276.83041 280.0224 282.5448 285.58081 291.67801 297.34079 300.53281 304.79279 307.8288 314.15399 320.634 327.186 330.22198 336.61801 341.85001 346.254 349.29001 355.43399 359.92081 366.40079 371.8728 374.90881 378.41281 384.582 388.98599 392.022 398.32321 403.39801 407.10599 409.62839"
         y="81"
         id="tspan160">hun altid kan ringe til dem og bede dem om at kigge forbi, hvis hun har brug for det. </tspan></text>

       id="text178"><tspan
         x="0 6.6479998 13.2 16.236 20.098801 25.7148 32.0508 35.242802 39.5028 45.382801 48.4188 54.754799 59.986801 65.458801 68.494797 71.998802 78.167999 82.571999 85.608002 91.342796 96.574799 101.0724 106.3044 109.3404 115.5564 120.6432 126.3408 131.7048 138.25681 144.55679 149.562 153.966 157.002 160.7448 163.9368 170.3316 173.35561 176.54761 182.01961 185.7276 188.7636 194.9328 204.8208 207.8568 217.7448 223.914 228.31799 233.76601 238.77119 245.3232 250.32719 256.87921 259.40161 262.0188 270.03479 277.88281 283.76279 289.42801 294.4104 300.89041 305.15039 310.22519 313.9332 316.96921 321.50519 324.6972 331.24921 336.6972 341.70239 346.10641 349.1424 355.0224 358.04639 360.56879 363.6048 369.36481 372.24481 378.00479 383.7648 386.28601 389.32199 395.54999 401.022 404.05801 408.31799 413.54999 416.586 421.59 425.99399 429.03 435.33121 440.3364 444.74039 447.7764 452.7804 459.3324"
         y="0"
         id="tspan168">En typisk dag for Sara begynder tidligt om morgenen. Vækkeuret ringer kl. 6.15, og så er der en </tspan><tspan
         x="0 3.7428 6.9348001 16.8228 21.862801 24.385201 27.4212 31.164 34.355999 37.380001 40.416 45.647999 49.355999 52.391998 58.717201 65.197197 71.749199 74.785202 81.013199 86.485199 89.521202 98.0784 104.3412 109.5732 115.9692 119.0052 123.2652 129.1452 134.3772 137.4012 140.43719 146.91721 153.2532 156.2892 161.54401 167.88 170.916 177.252 183.45599 187.716 192.72121 199.27319 201.79559 204.8316 210.5676 215.79961 220.29601 225.528 228.564 234.036 239.26801 243.672 246.70799 249.89999 252.936 259.116 264.37079 270.70679 273.7428 279.97079 285.44281 288.47879 293.95081 300.15479 304.55881 307.59479 317.48279 323.65079 328.05481 333.504 338.508 345.06 354.948 360.20401 366.504 371.50919 378.06119 381.0972 386.9772 390.00119 395.23318 398.96521 401.4888 404.52481 407.7168 414.2688 420.57001 425.5752 432.1272 435.16321 441.4884 447.96841 454.52039"
         y="27"
         id="tspan170">time, til at hun og Noah skal ud ad døren. Sara går i bad og gør morgenmaden klar, inden hun </tspan><tspan
         x="0 5.4840002 13.332 19.212 24.877199 29.882401 34.2864 37.322399 45.880798 52.1436 57.375599 63.771599 66.292801 69.328796 78.343201 83.575203 90.127197 93.1632 97.423203 103.3032 108.5352 111.5592 114.5952 120.9912 126.0216 131.3148 136.3548 139.39079 143.0988 149.3028 152.36279 155.3988 161.7348 166.9668 169.48801 172.524 178.752 184.224 187.25999 193.65601 198.888 205.44 208.476 212.73599 218.616 223.84801 226.87199 229.908 236.304 241.3344 246.62759 251.6676 254.7036 264.59161 270.75961 275.1636 280.61279 285.61679 292.16879 302.05679 307.31281 313.6488 316.1712 319.20721 329.09521 334.09921 340.65121 343.68719 350.08319 355.31519 361.86719 364.9032 370.56601 373.758 376.78201 379.81799 385.04999 388.07401 391.8168 395.00879 401.34479 404.3808 414.2688 419.35559 424.80359 429.87839 433.5864 436.62241 443.0184 448.0824 451.16519 454.18921 459.19321 463.45319 468.49319"
         y="54"
         id="tspan172">vækker Noah. Han skal have tøj på, og han skal have morgenmad, men han vil altid meget hellere </tspan><tspan
         x="0 3.0239999 8.1107998 13.56 18.6 21.1224 24.1584 30.1584 36.158401 42.158401 48.158401 54.158401 60.158401 66.158401 72.158401 78.158401 84.158401 90.158401 96.158401 102.1584 108.1584 114.1584 120.1584 122.6808 125.7168 131.4288 136.6608 139.69679 145.8528 148.8768 151.9512 157.2444 162.2496 166.65359 169.68961 175.42439 180.6564 185.15401 190.386 193.422 196.446 199.638 205.974 209.68201 212.718 216.978 220.75681 225.0168 230.05679 234.3168 238.5768 243.6516 247.3596 249.882 252.918 263.30042 268.30441 274.85641 277.8924 284.1936 289.23361 292.26959 298.82159 304.05359 308.45761 311.49359 316.72559 319.80719 322.83121 326.02319 331.47241 336.59399 341.88721 346.9512 349.97519 353.0112 358.24319 361.26721 365.01001 368.202 374.53799 377.57401 383.87399 388.95001 392.65799 395.694 402.09 407.1528 410.17679 415.2168 417.7392 420.77521 425.03519 430.26721 433.30319 439.03799 444.26999 448.76761 453.9996 457.03561 462.91559 468.14761 474.69958"
         y="81"
         id="tspan174">lege. ________________. Så bliver Sara lidt stresset. Men de når alligevel altid det hele, så Sara kan </tspan><tspan
         x="0 5.2319999 8.7720003 11.796 16.917601 22.2108 27.216 31.476 36.515999 39.551998 48.110401 54.373199 59.605202 66.001198 69.037201 72.229202 75.265198 80.7948 87.274803 92.770798 98.218803 103.2588 107.5188 111.2148 117.6948 122.7 129.252 132.28799 138.168 141.192 143.7144 146.7504 152.51041 155.3904 161.15041 166.9104"
         y="108"
         id="tspan176">aflevere Noah i vuggestuen kl. 7.30.</tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text194"><tspan
         x="0 8.8920002 14.124 18.528 21.540001 27.275999 32.507999 37.0056 42.237598 45.249599 51.645599 56.877602 61.281601 64.293602 69.525597 73.065598 76.0896 81.212402 86.5056 91.510803 95.770798 100.8456 104.5536 107.5656 116.1228 122.3856 127.6176 134.0136 136.536 139.548 143.256 148.48801 153.936 158.94 163.34399 166.356 172.6812 179.16119 185.7132 188.7252 191.91721 194.9292 199.18919 204.8316 211.0356 214.0596 219.09959 221.62199 224.634 233.4072 239.88721 246.43919 249.4512 254.45641 258.86041 261.87241 266.13239 269.84039 275.07239 279.67801 283.2804 288.35641 292.06439 295.07639 301.41241 306.64441 309.6564 316.13641 322.47241 328.80841 334.04041 340.59241 347.14441 352.20721 355.2312 359.49121 364.4964 371.0484 374.06039 377.80319 380.99521 384.0192 387.03119 391.2912 397.53 402.534 405.72601 410.95801 413.98199 418.362 421.37399 427.6008 433.07281 436.08481 440.31 446.79001 453.34201 459.67801 466.07401 471.13681 477.47281 481.73279 486.11279"
         y="0"
         id="tspan184">Når Sara har afleveret Noah, tager hun i skole. Hun er startet på uddannelsen til social- og sundheds- </tspan><tspan
         x="0 6.3959999 9.4560003 17.304001 20.327999 26.722799 31.726801 36.130798 39.166801 42.672001 48.841202 53.245201 56.2812 61.357201 65.065201 68.101196 74.437202 79.669197 84.073196 87.1092 96.9972 102.2292 108.7812 113.8452 120.1452 125.1504 129.5544 132.59039 136.8504 140.0424 146.3436 151.3476 157.8996 160.422 163.45799 172.2312 178.7112 185.2632 188.29919 193.3044 197.7084 200.7444 206.38319 209.4072 214.662 220.998 224.034 227.5392 233.7084 238.1124 241.14841 246.3804 250.08839 253.1244 258.59641 263.8284 266.86441 270.0564 273.09241 277.35239 282.99481 289.19879 292.22281 297.26279 299.78519 302.8212 309.04919 314.52121 317.55719 323.88239 330.3624 336.9144 339.95041 344.9556 349.35959 352.3956 362.2836 367.3692 372.81839 377.89319 381.6012 384.63721 390.2796 396.44879 403.00079 407.8728 412.8768 419.4288 423.20761 427.46759 432.47281 436.73279 441.80759 445.51559 448.03799 451.07401 460.96201 465.96719 472.5192 476.77921"
         y="27"
         id="tspan186">hjælper for et par måneder siden. Hun er glad for at gå i skole, og hun er meget koncentreret, mens </tspan><tspan
         x="0 6.3252001 12.8052 19.357201 22.3932 27.398399 31.802401 34.838402 41.139599 46.1436 49.876801 52.3992 55.4352 61.4352 67.435204 73.435204 79.435204 85.435204 91.435204 97.435204 103.4352 109.4352 115.4352 121.4352 127.4352 133.4352 139.4352 145.4352 151.4352 153.9576 156.99361 165.7668 172.2468 178.7988 181.83479 185.5428 188.6028 193.64281 199.5228 205.18919 210.19321 214.5972 217.63319 221.8932 226.9572 229.8636 235.3476 238.8876 245.0916 248.1156 253.5636 258.62759 261.65161 264.8436 270.31561 273.35159 277.6116 280.80359 287.35559 290.3916 293.99399 299.05801 302.082 307.09799 310.60321 316.7724 323.3244 326.36041 329.5524 332.58841 338.92441 344.1564 350.63641 354.89639 359.90161 364.38721 370.93921 375.97919 378.50159 381.5376 385.04279 391.21201 395.616 398.65201 404.1828 410.66281 416.15881 421.60681 426.64679 430.9068 434.60281 441.08279 446.08801 452.64001 455.67599 459.936 465.81601 471.048 474.07199"
         y="54"
         id="tspan188">hun er der. ________________. Hun tjekker selvfølgelig sin telefon i pauserne, for vuggestuen skal </tspan><tspan
         x="0 6.3959999 11.4252 16.719601 21.7596 24.795601 34.612801 41.0928 44.116798 47.3088 52.923599 59.319599 64.383598 70.719597 73.7556 77.259598 83.428802 87.832802 90.868797 96.1008 99.8088 102.8448 107.3808 110.5728 117.1248 122.5728 127.6128 130.6488 134.3916 137.5836 140.6076 143.6436 150.0396 155.04359 161.5956 167.8968 172.9368 175.4592 178.49519 184.59241 190.2552 193.4472 197.7072 200.74319 207.13921 212.3712 218.9232 221.9592 228.11639 231.1404 234.2148 239.508 244.5132 248.91721 251.9532 256.2132 261.55319 267.16919 269.69159 272.7276 283.1088 288.11401 294.66599 297.702 302.76599 305.8476 308.87161 313.8768 318.25681 322.51682 325.5528 330.55801 334.96201 337.99799 344.29919 349.37399 353.082 356.11801 361.78079 364.97281 370.44479 374.18759 377.37961 382.9212 387.18121 390.7836 395.82361 398.85959 402.36481 408.53281 412.9368 415.97281 422.3688 427.37399 433.92599 440.2272 445.26721 448.30319 453.53519 457.24319 460.27921 463.30319 471.15121 475.41241 480.45239"
         y="81"
         id="tspan190">have mulighed for at ringe til hende, hvis han bliver syg. Men ellers er det vigtigste for hende at lære </tspan><tspan
         x="0 6.552 12.78 18.228001 23.302799 27.010799 29.533199 32.569199 39.121201 44.353199 48.757198 51.793201 58.118401 64.598396 71.150398 74.186401 79.191597 83.595596 86.631599 89.823601 92.859596 97.119598 102.762 108.966 111.99 117.03 119.5524"
         y="108"
         id="tspan192">noget, når hun er i skole. </tspan></text>

         y="27"
         id="tspan128">de ved, at hun siger nej. Sara vil selvfølgelig gerne være sammen med sine venner fra skolen, men </tspan><tspan
         x="0 6.3252001 12.8052 19.357201 22.3932 26.6532 32.533199 37.765202 40.7892 43.825199 50.377201 55.6092 58.645199 63.877201 67.585197 70.621201 75.346802 80.566803 86.902802 93.204002 98.244003 101.28 107.4252 113.7612 116.7972 123.0252 128.49719 131.5332 137.028 142.25999 146.52 152.1864 157.22639 160.26241 163.9704 170.17439 173.1636 175.686 178.722 181.914 188.466 194.7672 199.77119 206.3232 209.35921 215.68559 222.1656 228.71761 231.7536 238.1496 243.1548 249.7068 253.3092 258.31439 262.71841 265.75439 274.31281 280.57559 285.80759 292.20361 294.72601 297.76199 303.72839 309.89639 314.30042 317.3364 323.8884 329.12039 333.52441 336.56039 345.11761 351.3804 356.6124 363.00839 366.0444 371.6868 377.85599 387.74399 397.63199 402.63599 407.04001 410.07599 416.47198 419.53201 424.5372 434.4252 437.46121 441.00119 445.49881 450.7308"
         y="54"
         id="tspan130">hun skal nå at rydde op og vaske tøj, inden hun henter Noah. For når Noah kommer hjem fra </tspan><tspan
         x="0 5.5307999 12.0108 17.5056 22.9548 27.994801 32.254799 35.950802 42.430801 47.470798 49.993198 53.029202 57.2892 63.169201 68.401199 71.425201 74.461197 80.7864 87.266403 93.818398 96.854401 103.2504 108.3132 111.3372 116.3772 119.4132 123.156 126.348 132.6492 137.6544 144.20641 147.2424 153.6384 159.84241 162.86639 169.1664 174.20641 177.2424 183.4464 186.50639 191.5464 194.5824 204.4704 209.53439 215.87041 218.39281 221.4288 227.5248 233.0208 238.2756 244.6116 247.6476 254.04359 259.2756 265.82761 268.86359 271.8876 276.91681 282.21121 287.21521 290.94839 293.47079 296.50681 302.7348 308.20679 311.2428 315.50281 320.7348 323.77081 329.65079 334.88281 341.43481 344.47079 350.79721 357.27719 363.82919 366.8652 370.05719 375.93719 381.60239 386.6424 389.67841 392.70239 397.7316 403.02481 408.06479 411.1008 415.36081 420.43561 424.14359 427.1796 437.0676 442.15439 447.60239 452.67841 456.38641"
         y="81"
         id="tspan132">vuggestue, skal hun hele tiden holde øje med, hvad han laver, og så kan hun ikke lave ret meget </tspan><tspan
         x="0 5.2319999 11.784 18.084 23.16 26.868 29.3904 32.426399 38.426399 44.426399 50.426399 56.426399 62.426399 68.426399 74.426399 80.426399 86.426399 92.426399 98.426399 104.4264 110.4264 116.4264 122.4264 128.42641 130.94881 133.9848 142.74361 147.8196 151.5276 154.5636 160.4436 165.6756 172.2276 175.2636 181.65961 186.66479 193.2168 199.51801 204.558 208.81799 211.854 217.73399 220.758 225.99001 230.25 234.50999 239.55 245.42999 250.662 260.54999 270.43799 275.44199 279.93961 285.1716 288.7728 293.77802 298.18201 301.21799 307.61401 312.67679 315.70081 322.0368 325.22879 330.70081 336.36359 339.5556 343.81561 346.85159 352.27679 358.51559 364.85159 368.5596 371.59561 375.1008 381.2688 385.64999 389.91 393.61801 398.85001 401.37241"
         y="108"
         id="tspan134">andet. ________________. Det kan hendes klassekammerater heldigvis godt forstå. </tspan></text>

    <text

       transform="matrix(1,0,0,-1,92.1222,642.1941)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text152"><tspan
         x="0 8.8920002 14.124 18.528 21.563999 27.2988 32.5308 37.0284 42.260399 45.296398 51.524399 56.996399 60.032398 68.5896 74.852402 80.084396 86.4804 89.516403 95.912399 101.1444 105.5484 108.5844 112.8444 119.1804 122.3724 126.6324 130.34039 133.3764 138.6084 142.14841 145.75079 150.756 157.308 161.56799 171.45599 176.7108 183.0468 185.5692 188.60519 192.8652 197.87041 202.2744 205.31039 211.6104 216.65041 219.6864 225.86639 232.0704 236.55721 243.10921 248.1492 252.52921 256.23721 261.09961 263.62201 266.65799 269.68201 277.53 281.79001 286.79401 291.198 294.23401 300.63 303.82199 308.082 311.67239 317.84161 322.37759 325.56961 330.57361 334.9776 338.01361 344.24039 349.7124 352.74841 357.00839 362.37241 368.92441 374.3736 379.37759 383.78159 386.8176 391.07761 396.3096 406.1976 416.0856 421.09079 427.64279 430.164 433.20001 438.93481 444.16681 448.6644 453.89639"
         y="0"
         id="tspan142">Når Sara og Noah har spist aftensmad, ser de børne-tv, læser historier og synger sammen. Sara </tspan><tspan
         x="0 6.336 12.7812 16.489201 20.090401 25.0956 29.499599 32.535599 38.763599 44.305199 48.565201 53.797199 56.833199 60.576 63.768002 67.475998 70.512001 79.070396 85.333199 90.565201 96.961197 99.9972 103.1892 106.2252 112.4052 117.6612 123.9972 126.5196 129.5556 133.0956 139.29961 143.7036 146.73959 153.1356 158.3676 164.9196 167.9556 172.21561 178.0956 183.32761 186.35159 189.3876 192.57961 195.6156 199.8756 204.8808 211.4328 217.04761 219.57001 222.606 232.9884 237.99361 244.54559 247.5816 253.8828 258.95761 262.66559 265.7016 270.70679 275.11081 278.14679 283.37881 286.4028 290.1456 293.33759 299.67361 302.70959 308.37241 311.56439 317.03641 320.77921 323.97119 329.44321 333.15121 336.18719 339.69119 345.86041 350.2644 353.30042 359.03519 364.26721 368.7648 373.9968 376.5192 379.55521 384.7872 388.49521 391.53119 397.92719 403.15921 409.71121 412.74719 417.0072 423.07919 428.37241 433.37759 437.78159 440.8176 447.14279 453.6228 458.22839 461.97119 465.16321 470.63519 474.3432 476.8656"
         y="27"
         id="tspan144">putter også tit Noah i bad, før han skal i seng. Men det er altid vigtigt for Sara, at han sover hurtigt. </tspan><tspan
         x="0 8.7732 15.2532 21.805201 24.8412 29.1012 34.981201 40.2132 43.237202 46.273201 52.825199 57.829201 67.717201 70.741203 73.933197 79.405197 82.4412 85.465202 90.4944 95.788803 100.8288 103.8648 106.8888 111.9288 117.8088 121.5516 124.7436 129.7476 133.4808 136.0032 139.0392 145.2672 150.7392 153.77521 159.87241 165.534 168.726 172.98599 176.022 184.5804 190.8432 196.0752 202.47121 205.5072 210.51241 214.9164 217.95239 223.4364 228.6684 234.11639 239.1216 245.6736 248.196 251.23199 257.112 262.34399 268.896 271.93201 278.2572 284.73721 291.28922 294.3252 297.51721 303.39719 309.06241 314.10239 317.1384 322.78079 328.95001 335.50201 340.37399 345.37921 351.93121 355.7088 359.96881 364.974 369.23401 374.27399 377.31 381.57001 384.76199 390.37799 392.90039 395.9364 404.8056 410.27759 413.3136 417.57361 422.8056 425.84161 430.8468 435.25079 438.2868 444.612 451.09201 457.64401"
         y="54"
         id="tspan146">Hun skal nemlig lave lektier, og hvis Noah er vågen, kan hun ikke koncentrere sig. Og så er hun </tspan><tspan
         x="0 6.552 12.756 19.091999 22.799999 25.836 29.5788 32.770802 35.7948 38.830799 44.062801 47.770802 50.806801 53.830799 61.678799 65.938797 70.978798 74.014801 80.1828 90.070801 93.106796 99.658798 104.8908 108.5988 112.2012 117.2064 123.7584 126.2808 129.3168 135.8688 141.1008 145.50481 148.5408 154.9368 160.16879 166.72079 169.75681 174.76199 181.314 187.614 192.67799 195.702 198.894 204.366 207.40199 211.662 217.73399 223.02721 228.03239 231.7644 234.2868 237.3228 243.5508 249.0228 252.05881 258.35999 263.43481 267.14279 270.1788 275.1828 279.58679 282.6228 287.15881 290.3508 295.82281 299.56561 302.7576 308.22961 311.26559 317.66159 322.89359 327.15359 333.48959 337.1976 339.72 342.75601 348.75601 354.75601 360.75601 366.75601 372.75601 378.75601 384.75601 390.75601 396.75601 402.75601 408.75601 414.75601 420.75601 426.75601 432.75601 438.75601 441.27841 444.31439 450.0264 455.25839 458.2944 461.79959 467.96881 472.3728"
         y="81"
         id="tspan148">nødt til at læse om natten, når han endelig sover, og det er rigtig hårdt. ________________. Så for </tspan><tspan
         x="0 6.3011999 11.376 15.084 18.120001 28.007999 33.048 37.307999 40.9104 45.950401 48.986401 52.526402 57.7584 62.162399 65.198402 71.523598 78.003601 84.555603 87.591599 91.851601 95.043602 101.5956 104.6316 111.1836 116.4156 120.1236 123.7248 128.7648 133.0248 139.22881 144.7128 151.2648 153.7872"
         y="108"
         id="tspan150">det meste får hun sin nattesøvn. </tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text168"><tspan
         x="0 8.7600002 13.764 18.167999 21.204 26.2092 30.613199 33.6492 43.537201 48.769199 55.321201 60.769199 65.809196 68.331596 71.367599 77.6688 82.672798 87.076797 90.112801 94.372803 100.7088 106.9128 111.3168 116.766 121.77 126.174 129.21001 134.946 140.17799 144.67439 149.9064 152.42999 155.466 161.634 171.522 174.558 180.88319 187.3632 193.91521 196.9512 201.95641 206.3604 209.39639 215.06281 220.1256 226.46159 229.4976 234.7296 238.26961 240.79201 243.828 249.06 252.76801 255.804 262.12921 268.60919 275.16119 278.1972 284.5932 289.8252 294.22919 297.2652 300.80521 306.0372 311.112 314.82001 317.85599 322.93079 326.63879 329.6748 335.8548 341.08679 345.57239 352.12439 355.1604 359.42041 364.6524 367.68839 371.43121 374.6232 381.01801 384.04199 387.23401 392.70599 396.414 398.93521 401.97119 412.35239 417.3576 423.90961 426.94559 433.24561 438.32159 442.0296"
         y="0"
         id="tspan158">Der er mange, der spørger Sara, om hun er ked af, at hun har fået et barn så tidligt. Men det </tspan><tspan
         x="0 5.0051999 9.4091997 12.4452 18.770399 25.250401 31.802401 34.838402 38.030399 43.9104 49.5756 54.615601 57.138 60.174 68.947197 75.4272 81.979202 85.015198 90.895203 96.127197 102.6792 105.7152 109.9752 115.038 117.9456 123.4296 126.9696 133.1736 136.1976 141.6456 146.70959 149.7336 152.9256 158.3976 161.43359 166.8588 173.0976 179.43359 183.1416 186.1776 196.0656 203.9136 208.3884 214.0536 219.0936 221.616 224.65199 229.884 233.592 236.62801 242.95441 249.4344 255.9864 259.0224 265.4184 270.65039 275.05441 278.09039 283.09561 289.64761 292.68359 296.46121 300.9588 305.9892 311.53079 314.55481 317.59079 323.68799 328.9812 333.98639 338.2464 344.5824 349.81439 355.43039 357.95279 360.9888 367.21561 372.68759 375.7236 382.04999 388.53 395.082 398.11801 403.1232 407.52719 410.5632 414.306 417.49799 421.20599 424.242 428.02081 432.4248 440.2728 443.9808 446.50201"
         y="27"
         id="tspan160">er hun ikke. Hun kan selvfølgelig godt mærke, at hun har en travl hverdag, og hun er tit træt. </tspan><tspan
         x="0 6 12 18 24 30 36 42 48 54 60 66 72 78 84 90 96 98.5224 101.5584 107.5248 113.6928 118.0968 121.1328 125.3928 130.4568 133.3632 138.6456 144.8136 154.7016 157.73759 164.0388 169.1136 172.82159 175.8576 180.86279 185.2668 188.3028 193.37759 197.0856 200.1216 204.38161 207.972 214.1412 218.7468 222.4548 225.4908 230.72279 235.2708 241.4856 246.6684 249.72839 256.0296 261.06961 264.10559 269.33759 273.04559 276.0816 282.4176 287.6496 291.90961 296.16959 301.20959 304.24561 312.8028 319.06561 324.29761 330.6936 333.216 336.25201 341.2572 345.66119 348.6972 354.336 357.35999 365.20801 371.508 376.51321 383.06519 386.1012 391.39441 396.4584 402.7944 405.83041 411.06241 414.77039 417.8064 424.20239 429.23279 434.526 439.56601 442.60199 448.99799 454.23001 464.11801"
         y="54"
         id="tspan162">________________. For selvom det er et stort arbejde at passe Noah, er glæden ved at have ham </tspan><tspan
         x="0 9.8879995 14.9748 20.4228 25.4988 29.2068 32.242802 36.5028 40.2108 46.414799 50.9496 55.209599 60.249599 62.773201 65.809196 74.823601 80.055603 86.607597 89.6436 94.647598 99.051598 102.0876 107.0928 113.6448 116.6808 122.9808 128.16479 131.22479 134.24879 137.4408 142.9128 145.94881 148.97279 152.16479 155.2464 158.2704 163.31039 166.34641 172.6824 176.9424 181.9464 188.4984 194.1144 196.6368 199.67281 203.9328 210.10201 219.99001 223.026 226.7688 229.9608 233.66879 236.7048 242.3076 245.38319 250.67641 255.6804 260.08441 263.12039 267.3804 270.57239 277.12439 280.1604 290.0484 296.21759 300.62161 303.65759 308.73239 312.4404 315.47641 319.73639 323.32681 329.496 334.10159 337.8096 340.84561 346.72559 353.19479 359.6748 363.93481 366.45721 369.49319 375.72119 381.19321 384.22919 390.5304 395.60519 399.3132 402.34921 407.95319 411.02759 416.3208 421.32599 425.73001 428.76599 435.16199 440.16599 446.71799 453.0192 458.0592"
         y="81"
         id="tspan164">meget større. Han er en dejlig lille dreng, som tit giver sin mor et stort knus, og det giver hende </tspan><tspan
         x="0 5.2319999 8.2559996 11.9988 15.1908 21.5268 24.562799 30.8388 36.202801 39.2388 44.243999 50.796001 55.801201 60.2052 65.807999 69 71.5224"
         y="108"
         id="tspan166">altid ny energi. </tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text118"><tspan
         x="0 3.7224 8.9544001 11.4768 14.5128 20.610001 26.106001 31.3608 37.6968 40.7328 44.992802 50.872799 56.104801 59.128799 62.164799 65.2248 70.3116 75.7836 78.819603 83.079597 86.271599 91.719597 96.759598 100.8636 103.8996 107.5728 112.6596 118.1316 121.1676 127.0476 132.2796 138.8316 141.8676 147.2928 153.5316 159.8676 163.57561 166.6116 169.6356 172.82761 179.1288 184.16879 187.2048 192.4368 196.14481 199.1808 205.3248 209.8116 216.2916 221.73959 226.7796"
         y="0"
         id="tspan90">Ja, hvad skal jeg sige? Jeg kan godt lide at bruge </tspan><tspan
         x="0 9.8879995 13.08 19.632 24.672001 27.708 34.104 41.952 48.504002 54.804001 59.8092 63.5424 66.064796 69.1008 75.327599 80.799599 83.835602 86.895599 91.982399 97.454399 100.4904 106.3704 111.6024 118.1544 121.1904 126.6156 132.8544 139.1904 142.89841 145.9344 148.9584 152.15041 158.45039 163.4904 166.5264 171.75841 175.4664 178.5024 183.73441 188.28239 194.49719 199.6812 202.7412 209.0412 214.08121"
         y="15.996"
         id="tspan92">mine hænder, og jeg kan godt lide at arbejde </tspan><tspan
         x="0 9.8879995 14.9508 21.2868 24.3228 34.2108 39.214802 45.7668 52.318802 57.358799 61.618801 67.283997 72.2892 76.693199 79.729202 85.956001 91.428001 94.463997 99.695999 103.404 106.44 111.912 118.116 122.3772 127.4172 130.4532 136.7532 141.75841 151.64639 154.6824 160.3212 163.3452 168.60001 174.9012 179.94119 182.46359 185.4996 194.37 199.842 202.87801 206.38319 212.5872 215.61121 221.4912"
         y="31.992001"
         id="tspan94">med mennesker og at gøre dem glade. Og folk </tspan><tspan
         x="0 6.3011999 11.3412 14.3772 20.533199 23.557199 26.632799 31.926001 36.93 41.334 44.369999 50.549999 55.782001 60.042 65.082001 68.117996 72.377998 77.610001 80.646004 86.284798 89.3088 94.564796 100.8648 105.9048 108.4272 111.4632 118.0152 123.2472 127.6512 130.68719 136.9884 141.9924 146.2536 151.29359 155.5536 158.5896 164.9856 170.21761 174.6216 177.65759 181.9176 185.1096 191.4456 197.7468 202.752 207.15601"
         y="47.987999"
         id="tspan96">de bliver bare så glade, når deres hår sidder </tspan><tspan
         x="0 5.4252 11.664 18 21.708 24.2304 27.266399 32.978401 38.2104 41.246399 47.5476 52.622398 56.330399 59.366402 64.862396 70.094398 74.498398 77.534401 84.086403 90.290398 96.170403 99.206398 105.5076 110.5476 113.5836 117.3612 121.6224 126.6624 129.69839 133.44119 136.63319 143.1852 148.6572 151.69321 155.436 158.62801 161.65199 165.912 171.144 181.032 190.92 195.924 202.476 204.9984 208.03439 214.3356 219.3396 223.74361"
         y="63.984001"
         id="tspan98">godt. Så det var nok de tre ting tilsammen, der </tspan><tspan
         x="0 5.4720001 8.5319996 14.7 18.961201 25.2624 30.302401 32.823601 35.8596 41.091599 44.799599 47.835602 50.895599 55.982399 61.454399 64.490402 69.986397 75.218399 78.242401 83.714401 87.316803 92.356796 95.392799 98.416801 101.6088 107.0568 112.0968 115.1328 121.434 125.838 133.686 138.69 141.882 146.142 149.17799 155.4792 160.554 164.26199 167.298 173.694 178.6992 183.1032 186.13921 189.6792 194.91119 200.526"
         y="79.980003"
         id="tspan100">gjorde, at jeg valgte lige præcis det her fag.</tspan><tspan
         x="272.12399 279.15601 284.388 290.68799 295.728 298.76401 301.87079 307.10281 310.13879 316.36679 321.83881 324.87479 331.42679 336.60959 339.60001 342.12241 345.15839 348.83041 353.91721 359.38919 362.4252 368.8212 374.05319 378.45721 381.49319 384.51721 389.74921 396.30121 401.74921 406.78922 409.8252 415.05719 419.60519 425.82001 431.004 434.064 440.39999 444.66 450.996 456.228 461.67599 466.716 469.2384 472.27441 476.53439 481.76639 484.8024 487.8624 492.94919 498.4212"
         y="-0.024"
         id="tspan102">Både ja og nej. Jeg har lange arbejdsdage, så jeg </tspan><tspan
         x="272.12399 277.12921 281.5332 284.56921 294.45721 299.54401 304.992 310.0668 313.77481 316.81079 322.2948 330.14279 336.0228 338.5452 341.58121 350.34119 355.41599 359.12399 362.16 367.164 371.56799 374.604 378.86401 383.92801 386.83441 392.31839 395.8584 402.06241 405.0864 410.53439 415.59839 418.62241 421.81439 427.28641 430.32239 433.5144 439.39441 445.0596 450.09961 453.13559 457.3956 462.62759 465.6636 472.03439 478.1796 484.51559 490.99561"
         y="15.972"
         id="tspan104">er meget væk. Det er selvfølgelig ikke så popu-</tspan><tspan
         x="272.12399 275.14801 282.996 287.60159 291.3096 293.832 296.86801 307.2504 312.25562 318.80759 321.8436 324.90359 329.99039 335.4624 338.49841 343.5036 347.90759 350.9436 357.49561 365.3436 369.60361 373.20599 378.20999 384.76199 387.798 393.03 396.05399 402.39001 406.92599 410.11801 415.59 418.62601 422.85001 429.32999 433.0632 435.5856 438.62161 442.1268 448.29599 452.70001 455.73599 465.62399 468.81601 472.52399 475.56 478.62 484.81201 490.992"
         y="31.968"
         id="tspan106">lært. Men jeg er næsten aldrig sur, for mit job </tspan><tspan
         x="272.12399 277.59601 283.79999 288.20401 291.23999 301.12799 304.32001 309.79199 312.828 318.4668 321.49081 326.74561 333.0816 335.604 338.64001 344.86801 350.34 353.37601 359.67599 364.75201 368.45999 371.496 377.09879 380.17441 385.46759 390.47159 394.87561 397.91159 402.91681 409.46881 414.474 418.87799 424.4808 427.67279 430.7088 434.4516 437.64359 440.6676 443.70361 449.93161 455.47321 459.73318 464.96521 468.00119 473.23318 476.94119 479.9772 485.46121 493.3092 497.56921 502.60919"
         y="47.964001"
         id="tspan108">gør mig glad, og det giver energi til også at være </tspan><tspan
         x="272.12399 277.35599 283.23599 286.97879 290.05319 295.5372 298.57321 304.87439 309.87961 314.35321 320.74921 323.8092 328.81439 338.70239 348.59039 353.6304 356.1528 359.18881 362.862 367.94879 373.42081 376.45679 381.46201 385.866 388.90201 392.40601 398.5752 402.97919 406.0152 411.05521 416.93521 421.19519 426.19919 436.08719 442.48199 447.54599 450.57001 453.60599 460.15799 468.00601 472.26599 475.86719 480.87241 487.42441"
         y="63.959999"
         id="tspan110">aktiv derhjemme. Jeg er for eksempel næsten </tspan><tspan
         x="272.12399 277.35599 280.38 284.1228 287.31479 293.65079 296.6868 303.0228 308.25479 312.75241 317.98441 321.69241 324.72839 328.47119 331.66321 334.68719 337.72321 342.9552 346.66321 349.69919 353.9592 360.2952 363.48721 366.56879 369.5928 374.63281 377.66879 382.74481 386.45279 389.4888 393.74881 400.08481 403.27679 406.30081 409.33679 419.22479 424.28879 430.62479 433.6608 439.84079 446.0448 450.5304 457.0824 462.08759 468.63959 473.6796 476.71561 481.7796 484.8624 487.88641 492.89041 497.2944"
         y="79.956001"
         id="tspan112">altid parat til at spille et spil med børnene eller </tspan><tspan
         x="272.12399 278.30399 283.53601 288.98401 294.02399 297.06 302.06519 308.61719 311.6532 314.67719 322.52521 328.40521 334.0704 339.07559 343.47961 346.51559 352.3956 357.62759 363.07559 368.1156 370.638 373.67401 379.38599 384.61801 387.65399 394.12439 400.6044 403.64041 407.418 411.65521 417.82321 422.2272 425.26321 428.32321 433.41 438.88199 441.918 445.45801 450.69 456.57001 460.31281 463.50479 467.7648 473.64481 476.16721 479.20319 484.43521 488.14319 491.1792 497.48041 502.55521 506.26321"
         y="95.952003"
         id="tspan114">bage en lækker kage. Så nu tror jeg faktisk, at det </tspan><tspan
         x="272.12399 277.12921 281.5332 284.56921 290.77319 296.6532 301.6824 306.30481 308.82721 311.86319 317.09521 320.80319 323.8392 326.8992 331.98599 337.45801 340.49399 345.49921 349.9032 352.93921 356.5416 361.54559 371.43359 381.32159 386.38559 389.40961 392.60159 398.07361 401.10959 410.99759 416.08441 421.5336 426.6084 430.31641 433.35239 438.8364 446.68439 452.56439"
         y="111.948"
         id="tspan116">er okay, at jeg er temmelig meget væk.</tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text148"><tspan
         x="0 7.4759998 11.184 14.22 24.108 29.34 35.891998 38.928001 43.188 49.355999 59.243999 69.132004 74.171997 77.208 80.952003 84.143997 90.444 95.449203 99.853203 102.8892 106.0812 111.9612 117.6264 122.6664 125.7024 131.5824 136.81441 143.36639 146.4024 150.6624 156.73441 162.0276 167.0676 169.59 172.62601 176.1312 182.3004 186.56039 192.89639 196.08839 199.1244 209.01241 214.2444 220.7964"
         y="0"
         id="tspan124">At man somme tider ikke kan sove, fordi man </tspan><tspan
         x="0 3.7079999 11.556 18.108 23.773199 28.7784 33.1824 36.218399 42.554401 47.7864 50.822399 57.217201 62.221199 68.773201 74.222397 79.262398 81.784798 84.583199 92.288399 95.312401 99.020401 103.2804 108.5124 111.5484 117.9444 123.1764 127.5804 130.61639 140.50439 145.7364 152.28841 155.3244 161.79359 168.27361 171.3096 177.18961 183.6696 190.2216 196.5228 201.52679 205.9308 208.9668 215.5188 221.72279 227.6028 230.1252"
         y="15.996"
         id="tspan126">tænker på penge. Altså har man nu kunder nok, </tspan><tspan
         x="0 6.2280002 11.7 14.736 18.444 21.504 26.509199 33.061199 38.066399 42.470402 45.506401 55.394402 60.6264 67.178398 70.214401 76.766403 82.970398 88.850403 92.954399 95.990402 106.5156 111.7476 118.2996 121.3356 127.7316 132.96359 137.3676 140.40359 143.46359 149.6676 152.7036 162.5916 167.82359 174.3756 179.82359 184.8636 187.8996 194.37959 200.71561 206.31841 209.51041 213.0504 216.6528 221.658 225.3912 227.9136"
         y="31.992001"
         id="tspan128">og tjener man nok? Man har jo mange udgifter. </tspan><tspan
         x="0 10.5252 15.7572 22.3092 25.3452 29.6052 35.485199 40.717201 43.741199 46.777199 52.992001 58.066799 61.774799 67.006798 70.0308 75.070801 78.106796 84.433197 90.9132 95.173203 98.197197 103.38 106.44 111.48 114.0024 117.0384 127.5636 132.79559 139.3476 142.38361 146.6436 152.5464 157.9572 160.9812 167.28239 172.2876 176.6916 179.7276 185.90759 191.1396 197.6916 203.3568 208.362 214.914"
         y="47.987999"
         id="tspan130">Man skal betale husleje. Man skylder banken </tspan><tspan
         x="0 6.3948002 11.3988 17.9508 23.4 28.440001 30.9624 33.998402 44.523602 49.7556 56.307598 59.343601 63.6036 69.483597 74.715599 77.739601 80.775597 86.655602 92.859596 99.074402 104.1144 107.1504 113.4264 118.6476 123.6876 126.7236 130.4664 133.6584 140.2104 145.8252 148.3476 151.38361 160.1436 165.2184 168.92641 171.9624 177.84241 183.0744 189.6264 192.6624 197.89439 200.9184 204.6264"
         y="63.984001"
         id="tspan132">penge. Man skal købe nye ting. Det kan alt </tspan><tspan
         x="0 4.2600002 9.4919996 19.379999 29.268 34.271999 40.824001 43.860001 49.285198 55.5252 61.861198 65.569199 68.605202 74.077202 80.281197 84.542397 89.582397 92.618401 97.622398 104.1744 107.2104 113.7624 118.7676 123.4236 128.90759 135.1116 139.3716"
         y="79.980003"
         id="tspan134">sammen godt gøre en nervøs.</tspan><tspan
         x="272.12399 275.84641 281.0784 283.6008 286.63681 291.8688 294.89279 298.6008 302.86081 308.0928 310.6152 313.65121 323.53922 328.77121 335.32321 338.35919 342.6192 348.49921 353.7312 356.75519 359.7912 362.8512 369.05521 372.09119 377.5752 385.42319 389.6832 394.72321 397.75919 403.18439 409.42319 415.75919 418.7952 422.53922 425.7312 428.75519 431.7912 437.02319 440.7312 443.76721 447.2724 453.44159 458.04721 461.75519 469.60321 472.686 475.70999 480.75 483.78601 487.29001 493.49399 496.51801 502.39801 504.92041"
         y="-0.024"
         id="tspan136">Ja, altså, man skal jo være god til at fortælle folk, </tspan><tspan
         x="272.12399 278.22119 283.71719 288.97198 295.30801 298.34399 304.6452 309.68521 312.72119 316.9812 322.86121 328.0932 331.11719 334.1532 339.62521 345.82919 350.09039 355.1304 357.6528 360.68881 369.55801 375.03 378.06601 387.95401 393.186 399.73801 402.77399 407.034 412.914 418.146 421.17001 424.20599 427.71121 433.8804 438.26041 442.52039 446.22839 451.46039 453.98279 457.0188 462.25079 465.9588 468.99481 472.49881 478.70279 481.72681 487.60681 490.64279 495.64801 500.052"
         y="15.972"
         id="tspan138">hvad de skal gøre. Og man skal forstå, at folk er </tspan><tspan
         x="272.12399 275.62921 281.79721 286.17841 290.43839 296.10361 301.1676 304.2504 307.27441 310.4664 315.9144 320.95441 323.47681 326.51279 332.74081 338.2128 341.24881 346.4808 350.18881 353.22479 359.526 364.6008 368.30881 371.34479 374.8848 380.11679 385.9968 389.73959 392.93161 397.19159 403.07159 406.1076 411.11279 415.51682 418.5528 423.97681 430.2168 436.5528 440.2608 442.7832 445.81921 454.68839 460.1604 463.19641 467.45639 472.68839 475.7244 479.98441 485.86441 491.09641 494.12039"
         y="31.968"
         id="tspan140">forskellige, og at det faktisk er godt. Og så skal </tspan><tspan
         x="272.12399 282.01199 287.24399 293.79599 296.832 302.49481 305.6868 309.94681 314.98679 318.0228 324.32401 329.32919 339.21719 341.73959 344.7756 350.0076 353.71561 356.75159 366.63959 371.87161 378.42361 381.45959 386.46481 390.8688 393.90479 398.90881 405.46078 408.4968 414.13681 417.1608 422.41559 428.75159 431.7876 438.0144 443.48639 446.5224 451.8168 456.8208 463.3728 466.39679 469.58881 475.06079 478.0968 484.49161 489.4968 493.608"
         y="47.964001"
         id="tspan142">man vise dem, at man er en glad og venlig per-</tspan><tspan
         x="272.12399 276.384 282.55319 289.10519 291.62759 294.6636 303.42239 308.49841 312.20639 315.2424 320.71439 326.9184 331.32239 334.3584 338.61841 341.81039 351.69839 358.0932 363.15601 366.17999 369.888 376.284 381.28922 387.84119 390.36359 393.3996 398.63159 402.3396 405.37561 411.6756 416.68079 421.08481 424.12079 427.31281 433.19281 438.858 443.89801 446.93399 453.09119 456.1152 459.18961 464.48279 469.48801 473.892 476.92801 481.18799 486.42001"
         y="63.959999"
         id="tspan144">son. Det gør simpelthen, at der ikke bliver så </tspan><tspan
         x="272.12399 282.01199 287.24399 293.79599 299.24399 304.284 307.32001 313.62119 317.8584 324.05042 330.20639 333.23041 338.2356 348.1236 353.12759 356.86081"
         y="79.956001"
         id="tspan146">mange problemer.</tspan></text>

       id="text176"><tspan
         x="0 8.7600002 13.8348 17.542801 20.5788 25.872 30.936001 37.271999 40.307999 43.368 48.453602 53.925598 56.961601 60.153599 66.0336 71.699997 76.739998 79.776001 84.311996 87.503998 92.975998 96.718803 99.910797 105.5256 108.048 111.084 116.796 122.028 125.064 129.32401 135.20399 140.436 143.46001 146.496 149.556 154.64281 160.11481 163.1508 166.8588 169.91879 174.92281 181.47479 186.5148 189.5508 194.08681 197.27879 202.75079 206.49361 209.68559 215.15759"
         y="0"
         id="tspan154">Det ved jeg ikke rigtig. Så skal jeg tjene rigtig </tspan><tspan
         x="0 9.8879995 15.12 21.672001 27.120001 32.16 35.195999 41.590801 46.596001 53.147999 58.596001 63.636002 66.158401 69.194397 78.063599 83.535599 86.571602 89.631599 94.718399 100.1904 103.2264 108.8892 112.0812 115.1052 118.1412 121.2012 127.4052 130.44119 136.668 142.2108 146.47079 151.7028 154.7388 160.1868 165.192 169.6776 176.2296 181.26961 184.3056 190.7016 195.7308 201.024 206.064 209.10001 212.84399 216.036 222.37199 225.408 229.15199 232.34399 235.368"
         y="15.996"
         id="tspan156">mange penge. Og jeg vil jo også gerne have tid til </tspan><tspan
         x="0 6.3011999 11.3052 21.193199 24.2292 30.530399 35.535599 40.009201 46.405201 49.465199 54.470402 64.358398 74.246399 79.2864 81.807602 84.843597 91.539597 94.505997 100.986 107.322 111.582 116.6448 119.6688 122.8608 128.33279 131.3688 136.37399 140.778 143.814 149.994 156.198 160.68359 167.2356 172.23959 178.7916 183.8316 186.8676 192.14999 198.354 204.23399 208.494 215.04601 220.086 222.60719"
         y="31.992001"
         id="tspan158">dem derhjemme. Pludselig er børnene voksne. </tspan><tspan
         x="0 5.7119999 10.944 13.98 17.757601 21.994801 28.164 32.568001 35.604 38.664001 43.750801 49.222801 52.258801 58.728001 65.208 68.244003 74.795998 81 86.879997 89.402397 92.4384 95.498398 100.5852 106.0572 109.0932 114.756 117.948 120.972 124.008 130.164 133.188 136.26241 141.5556 146.5956 149.63161 155.298 160.362 166.698 169.73399 174.966 178.506 181.0284 184.06441 189.2964 193.00439 196.04041 199.1004 204.18719 209.65919 212.69521 219.0912 224.3232 228.7272"
         y="47.987999"
         id="tspan160">Så tror jeg nu nok, jeg vil blive ked af, at jeg har </tspan><tspan
         x="0 6.1451998 10.6308 17.1108 22.5828 26.2908 29.326799 34.5588 37.582802 40.618801 50.506802 53.698799 60.250801 63.2868 67.0308 70.222801 76.5588 79.594803 85.930801 91.162804 94.198799 97.258797 103.452 109.584 115.8 120.8748 124.5828 127.1052 130.1412 140.52361 145.5276 152.07961 155.1156 165.0036 170.2356 174.49561 180.162 185.202 188.23801 192.498 197.502 204.054 209.0592 213.3192 218.35921 220.88161"
         y="63.984001"
         id="tspan162">brugt al min tid på jobbet. Men måske senere, </tspan><tspan
         x="0 6.552 11.784 16.188 19.224001 25.403999 31.608 36.093601 42.645599 47.650799 54.202801 59.242802 62.278801 67.283997 71.688004 74.723999 78.984001 82.692001 88.896004 93.431999 97.692001 102.732"
         y="79.980003"
         id="tspan164">når børnene er større.</tspan><tspan
         x="272.12399 280.884 285.9588 289.66681 292.70279 297.70801 302.112 305.14801 311.54401 316.776 321.0372 327.3732 331.08121 333.60239 336.6384 346.5264 351.53159 358.08359 361.1196 367.42081 372.49561 376.20361 379.23959 384.24481 388.6488 391.68481 397.91281 403.4556 407.71561 412.9476 415.98361 420.24359 423.30359 429.37561 434.85959 438.5676 441.09 444.12601 452.88599 457.96078 461.66879 464.7048 469.70999 474.11401 477.14999 483.54599 488.77802 493.03799 499.37399 503.082 505.6044"
         y="-0.024"
         id="tspan166">Det er hårdt, men det er også sjovt. Det er hårdt, </tspan><tspan
         x="272.12399 277.35599 281.064 284.10001 293.98801 299.22 305.772 308.80801 315.20401 320.26682 323.2908 328.33081 331.36679 335.10959 338.30161 344.60281 349.60681 356.15881 359.19479 363.4548 369.33481 374.5668 377.59079 380.6268 384.33481 392.1828 398.7348 404.40121 409.44119 412.4772 418.8132 424.0452 427.08121 433.47601 438.4812 445.0332 450.4812 455.52121 458.04361 461.07959 467.30759 472.7796 475.81561 482.1156 487.19159 490.8996"
         y="15.972"
         id="tspan168">at man hele tiden skal tænke på penge, og det </tspan><tspan
         x="272.12399 276.384 282.26401 287.496 290.51999 293.556 303.444 308.67599 315.228 317.7504 320.78641 326.75159 332.92081 337.3248 340.36081 346.66199 351.66599 356.07001 359.10599 364.11121 368.5152 371.55121 376.08719 379.27921 384.75119 388.49399 391.686 397.15799 400.194 410.082 415.314 421.866 427.31519 432.35519 435.3912 438.93121 443.46719 446.65921 450.91919 457.1232 461.38321 466.3884 470.12161 472.64401 475.67999 479.94 485.172 488.20801 498.09601 503.328 509.88"
         y="31.968"
         id="tspan170">skal man. For der er rigtig mange frisører, så man </tspan><tspan
         x="272.12399 276.384 282.26401 287.496 290.51999 293.556 297.81601 304.01999 308.42401 313.87201 318.91199 321.948 325.45319 331.62119 336.02521 339.06119 344.29321 348.00119 351.0372 357.4332 363.63721 366.66119 372.9624 378.00241 381.03839 387.37439 392.60641 395.6424 401.5224 408.00241 414.55441 420.8544 425.85959 430.34521 436.89719 441.93719 444.45959 447.49561 457.8768 462.88199 469.43399 472.47 478.77121 483.84601 487.55399 490.59 495.59521 499.99921"
         y="47.964001"
         id="tspan172">skal sørge for at holde på kunderne. Men det er </tspan><tspan
         x="272.12399 276.384 279.444 285.51599 291 294.70801 297.23041 300.26639 303.77039 309.93961 314.19958 320.53561 323.7276 326.76361 336.65161 341.88361 348.43561 351.47159 355.7316 360.79559 363.702 369.186 372.22198 378.26999 383.60999 389.10599 394.55399 399.5592 403.9632 406.99921 413.55121 419.77802 425.2272 430.302 434.01001 437.04599 443.19119 449.24039"
         y="63.959999"
         id="tspan174">sjovt, fordi man selv bygger noget op.</tspan></text>

       xml:space="preserve"
       transform="matrix(1,0,0,-1,79.37,185.1811)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:14px;font-family:'Minion Bold';-inkscape-font-specification:Minion-Bold;writing-mode:lr-tb;fill:#ffffff;fill-opacity:1;fill-rule:nonzero;stroke:none"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,79.37,167.6772)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text208"><tspan
         x="0 8.7600002 13.8348 17.542801 20.5788 25.584 29.988001 33.023998 37.284 42.768002 50.616001 55.222801 58.930801 61.966801 67.198799 70.906799 73.942802 78.202797 81.394798 86.844002 91.884003 94.406403 97.442398 100.9464 107.1156 111.5196 114.5556 120.8568 125.8608 130.2648 133.3008 138.306 142.71001 145.746 150.006 155.23801 158.274 168.162 173.24879 178.69679 183.77161 187.4796 190.002 193.03799 203.42039 208.4256 214.9776"
         y="0"
         id="tspan182">Det er svært at sige, for der er så meget. Men </tspan><tspan
         x="0 9.8879995 15.12 19.379999 25.0452 30.085199 32.608799 35.644798 40.876801 44.584801 47.6208 50.680801 55.767601 61.239601 64.275597 69.292801 72.832802 76.435204 81.439201 85.914001 92.309998 97.542 104.094 110.394 115.3992 121.9512 124.9872 131.38319 136.6152 141.0192 144.05521 149.0592 155.61121 158.6472 165.0432 170.10719 173.1312 176.16721 182.46719 187.5312 190.55521 193.5912 197.1312 202.3632 206.6232 210.2256 215.26559"
         y="15.996"
         id="tspan184">måske, at jeg efterhånden har en hel del faste </tspan><tspan
         x="0 5.8800001 12.36 18.912001 25.212 30.217199 33.950401 36.472801 39.508801 48.268799 53.3088 56.344799 62.500801 65.524803 68.599197 73.8936 78.897598 83.301598 86.337601 92.889603 100.7376 104.9976 108.6 113.6052 120.1572 123.1932 128.1972 134.74921 137.7852 142.0452 145.0692 150.30119 155.8428 160.1028 163.13879 168.4332 173.43719 179.9892 186.5412 191.5464 195.2796 197.802 200.838 204.342 210.5112 214.91521"
         y="31.992001"
         id="tspan186">kunder. De bliver næsten en slags venner, for </tspan><tspan
         x="0 4.2600002 10.4292 20.3172 23.353201 26.8932 31.427999 34.619999 38.880001 45.084 49.487999 52.523998 56.784 63.335999 68.568001 74.447998 80.113197 85.118401 89.5224 92.558403 102.4464 107.6784 114.2304 117.2664 120.3264 126.5304 129.56641 139.45441 144.5412 149.9892 155.064 158.772 161.808 171.696 176.75999 183.09599 186.132 192.01199 198.492 205.04401 211.34399 216.3492 220.83479 227.3868 232.4268 234.9492"
         y="47.987999"
         id="tspan188">som frisør snakker man jo meget med kunderne. </tspan><tspan
         x="0 10.5252 15.7572 22.3092 25.3452 29.6052 36.1572 41.389198 47.269199 52.934399 57.939602 62.343601 65.379601 71.548798 81.436798 83.959198 86.995201 93.091202 98.587196 103.8432 110.1792 113.2152 123.1032 128.33521 134.88721 137.9232 143.3952 148.6272 153.0312 156.0672 162.29401 167.76601 170.802 173.826 178.8564 184.1496 189.1548 192.888 195.4104 198.4464 204.6732 210.1452 213.1812 219.2784 224.7744 230.02921 236.3652"
         y="63.984001"
         id="tspan190">Man snakker om, hvad man går og laver, og hvad </tspan><tspan
         x="0 9.8879995 15.12 21.672001 24.708 28.416 36.264 42.816002 48.481201 53.486401 57.8904 60.926399 67.153198 72.625198 75.661201 85.549202 90.554398 97.1064 102.1104 106.5144 109.5504 115.7196 125.6076 128.6436 133.8756 136.8996 140.6076 143.6436 153.4608 159.9408 162.9648 166.1568 171.6288 175.33681 177.85921 180.8952 189.65401 194.73 198.438 201.474 206.478 210.882 213.918 220.09801 225.33 231.6312 236.6712"
         y="79.980003"
         id="tspan192">man tænker og mener om alt muligt. Det er både </tspan><tspan
         x="0 4.2600002 10.596 18.444 24.996 31.296 36.301201 42.853199 49.1544 54.194401 57.2304 63.457199 68.929199 71.965202 78.266403 83.449203 86.509201 89.533203 92.725197 98.197197 101.9052"
         y="95.975998"
         id="tspan194">spændende og dejligt.</tspan><tspan
         x="272.12399 275.79721 280.884 286.35599 289.392 295.78799 301.01999 305.42401 308.45999 311.51999 317.724 320.76001 325.01999 330.25201 333.276 339.44519 345.99719 349.0332 352.22519 358.77719 365.07721 370.11719 373.1532 383.0412 386.23318 392.56921 396.27719 399.3132 402.50519 405.5412 411.5892 416.8092 421.81439 428.36639 430.88879 433.9248 438.18481 443.41681 446.45279 452.84879 457.85281 462.25681 465.29279 470.93521 477.1044 486.9924 496.8804 501.8844 506.28839"
         y="-0.024"
         id="tspan196">Jeg har jo salon inde midt i byen, så her kommer </tspan><tspan
         x="272.12399 282.01199 287.24399 293.79599 299.24399 304.284 307.32001 310.8252 316.99319 321.37439 325.6344 331.29959 336.36359 339.44641 342.4704 345.66241 351.11041 356.15039 359.1864 363.44641 366.4704 371.70239 377.24399 381.504 384.54001 394.42801 399.4332 405.9852 412.5372 417.57721 421.83719 427.5036 432.5076 436.24081 438.76321 441.79919 450.76559 455.77081 460.1748 463.21078 468.85321 475.0224 484.9104 494.7984 499.8024 504.20639"
         y="15.972"
         id="tspan198">mange forskellige slags mennesker. Her kommer </tspan><tspan
         x="272.12399 278.30399 283.53601 289.83719 294.8772 297.91321 304.3092 309.37201 312.396 316.104 319.14001 325.62 332.172 337.62 342.66 345.69601 351.92401 357.396 360.43201 366.82559 371.83081 378.38281 382.64279 385.83481 392.004 398.556 401.74799 406.008 409.60919 414.61441 418.3476 420.87 423.90601 430.93799 437.142 441.62759 448.1796 451.21561 456.858 463.02719 472.91519 482.80319 487.80719 492.21121"
         y="31.968"
         id="tspan200">både helt unge og pensionister. Børn kommer </tspan><tspan
         x="272.12399 278.51999 283.52399 287.92801 290.96399 297.1908 302.73361 306.99359 312.22559 314.7468 317.78281 322.04279 327.10681 330.01321 335.49719 338.5332 344.83441 349.87439 352.9104 359.3064 364.3692 367.39319 371.1012 374.13721 378.39719 388.28519 393.51721 396.03961 399.07559 407.94479 413.41681 416.45279 420.7128 425.94479 428.9808 434.6232 440.79239 450.68039 460.56839 465.57239 469.97641 473.01239 479.3136 484.31879 488.72281"
         y="47.964001"
         id="tspan202">her også, selv de helt små. Og så kommer der </tspan><tspan
         x="272.12399 276.384 281.44681 284.3544 289.83841 293.37839 299.5824 302.60641 308.05441 313.11719 316.1412 319.33319 324.80521 327.84119 334.06921 339.61081 343.87079 349.10281 352.13879 362.02679 367.03201 373.58401 380.13599 385.17599 389.436 395.1012 400.10641 404.51041 407.54639 413.88239 419.11441 422.15039 432.03839 435.23041 441.78241 444.81839 449.90521 455.35321 460.3584 466.9104 469.94641 475.17841 478.20239 484.5036 489.50879 493.242 495.7644"
         y="63.959999"
         id="tspan204">selvfølgelig også mennesker på min egen alder. </tspan><tspan
         x="272.12399 279.82919 282.85321 286.56119 290.8212 296.05319 299.0892 303.34921 308.58121 314.91721 320.1492 326.7012 329.73721 336.28922 342.51599 348.15601 351.17999 356.22 359.25601 365.59201 370.82401 373.85999 378.8652 385.41721 388.45319 394.2132 399.97321 404.35321 410.11319 415.8732 418.90921 424.1412 427.8732"
         y="79.956001"
         id="tspan206">Altså sådan nogle på en 30-40 år.</tspan></text>
